function fillTable(e){var t=$("#orders-rows");$.each(e,function(e,a){var r="";r+=createElement("td",a.id),r+=createElement("td",a.solicitante),r+=createElement("td",a.cep),r+=createElement("td",a.rua),r+=createElement("td",a.numero),r+=createElement("td",a.bairro),r+=createElement("td",a.cidade),r+=createElement("td",a.estado),r+=createElement("td",a.pais),r+=createElement("td",a.data_de_compra);var d=createElement("tr",r);t.append(d)})}var query="SELECT p.*, s.nome AS solicitante FROM pedidos p JOIN solicitantes s ON s.id = p.id_solicitante ORDER BY p.data_de_compra DESC";mysqlQuery(query,function(e){var t=JSON.parse(e);fillTable(t)});